	durationIn int,
    genreIn varchar (255)
)
begin
	declare table_name varchar (255);
    declare total int default 0;
    set table_name = concat('temp', genreIn);		
    set total = 0;
   
	while total <= durationIn do
        
      
			insert ignore into temp 
            select t.tracks_id, t.deez_tracks_id, t.track_title, t.duration, t.rank, t.artist, t.genre from tracks as t
